                      $name = '';
                      $email = '';
                      $message = '';

                      function validate_input($data) {
                        $data = trim($data);
                        $data = stripslashes($data);
                        $data = htmlspecialchars($data);
                        return $data;
                      }

                      if ($_SERVER["REQUEST_METHOD"] == "POST") {
                        $name = validate_input($_POST["name"]);
                        $email = validate_input($_POST["email"]);
                        $message = validate_input($_POST["message"]);

                        $contacter = fopen("contacts.csv", "a") or exit("Sorry, unable to open file");
                        $info = $name . "," . $email . "," . $message . "\r\n";
                        fwrite($contacter, $info);
                        fclose($contacter);
                        mail("zl743@nyu.edu", "New Message from " . $name . "email: " . $email,$message);
